import React, { useEffect } from "react";
import "./home.css";
import AOS from "aos";
import "aos/dist/aos.css";

const Vision = () => {
  useEffect(() => {
    AOS.init({ duration: 1000, once: true }); // Initialize AOS
  }, []);

  return (
    <div>
      {/* Company Vision */}
      <div
        className="container3"
        style={{
          position: "relative", // Make container the reference for absolute positioning
          backgroundImage: "url('/images/bg2.png')", // Background in React
          backgroundRepeat: "no-repeat",
          backgroundPosition: "center",
          backgroundSize: "cover",
          width: "100%",
          height: "400px", // Adjust as needed
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        {/* Overlay Text (Now inside .container3) */}
        <div
          className="text-overlay1"
          data-aos="fade-up"
        >
          <h1>Our Vision</h1>
          <p >
            We aim to revolutionize the industry by providing cutting-edge solutions and sustainable growth.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Vision;
